//=====================================| Import the Module |=====================================\\
const { Client, GatewayIntentBits, Partials, Collection, ChatInputCommandInteraction, ActivityType, PresenceUpdateStatus } = require("discord.js");
const { readdirSync } = require("fs");
const moment = require("moment");
const color = require("colors");
require("dotenv").config();

//=====================================| Code |=====================================\\

//====================< Main >===================\\
const client = new Client({
    intents: [
        GatewayIntentBits.Guilds,
        GatewayIntentBits.GuildMessages,
        GatewayIntentBits.GuildMembers,
        GatewayIntentBits.GuildMessageReactions,
        GatewayIntentBits.MessageContent,
    ],
    partials: [
        Partials.Channel,
        Partials.GuildMember,
        Partials.Message,
        Partials.Reaction,
        Partials.ThreadMember,
        Partials.User,
    ],
    allowedMentions: { parse: ["users", "roles"] }
});

client.commands = new Collection();

//====================< Login >===================\\
client.login(process.env.TOKEN).then(() => {
    console.log(`${color.bold.bgBlue(`[${moment().format("dddd - DD/MM/YYYY - hh:mm:ss", true)}]`)} ` + `${color.bold.green(`[INDEX > LOGIN]`)} ` + `Start login to Discord client...`.yellow);

}).catch(err => {
    console.log(`${color.bold.bgBlue(`[${moment().format("dddd - DD/MM/YYYY - hh:mm:ss", true)}]`)} ` + `${color.bold.red(`[INDEX > ERROR]`)} ` + `${err.stack}`.bgRed);
});

//====================< InteractionCreate >===================\\
/**
 * @param {ChatInputCommandInteraction} interaction
 * @param {Client} client
 */
client.on("interactionCreate", async (interaction) => {
    if (interaction.isChatInputCommand()) {
        if (interaction.user.bot) return;
        const command = client.commands.get(interaction.commandName);
        command.execute(client, interaction);
    };
});

